// Define API configuration first

import axios from "axios";



export const createAuthConfig = (apiUrl, data) => {
  return {
    url: `${apiUrl}`,
    method: "post",
    data,
  };
};

export const apiRequest = async (data) => {
   const  apiUrl =   "https://mobile-services-92086589662.us-central1.run.app/CountryCodes",
    config = await createAuthConfig(apiUrl, data);
   try {
    const response = await axios(config);
    return response.data;
  } catch (error) {
    console.log("error", error);
    throw error;
  }
};
